import { Routes, Route } from "react-router-dom";
import Home from "./components/Home/Home";
import Game from "./components/Game/Game";


function App() {
  return (
    <div className="App">
        <HashRouter>
        <Routes>
            <Route path="/" element={<Home/>} />
            <Route path="/game" element={<Game/>} />
        </Routes>
        </HashRouter>
    </div>
  );

}

export default App;
